import React, {Component} from 'react';

export const StudentContext = React.createContext();

export class StudentProvider extends Component {
  constructor(props) {
    super(props);

    this.state = {
      isAuthenticated: false,
      email: null
    }
  }
  render() {
    return (
      <StudentContext.Provider value={{
        state: this.state
      }}>
        {this.props.children}
      </StudentContext.Provider>
    )
  }
}
